    TResult Function(CategoryChanged value)? categoryChanged,
    TResult Function(MemberChanged value)? memberChanged,
    TResult Function(MemberAdded value)? memberAdded,
    TResult Function(MemberRemoved value)? memberRemoved,
    TResult Function(TotalExpenditureChanged value)? totalExpenditureChanged,
    TResult Function(Created value)? created,
    TResult Function(Updated value)? updated,
    TResult Function(Deleted value)? deleted,
  }) {
    return deleted?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(Initialized value)? initialized,
    TResult Function(NameChanged value)? nameChanged,
    TResult Function(DescriptionChanged value)? descriptionChanged,
    TResult Function(CategoryChanged value)? categoryChanged,
    TResult Function(MemberChanged value)? memberChanged,
    TResult Function(MemberAdded value)? memberAdded,
    TResult Function(MemberRemoved value)? memberRemoved,
    TResult Function(TotalExpenditureChanged value)? totalExpenditureChanged,
    TResult Function(Created value)? created,
    TResult Function(Updated value)? updated,
    TResult Function(Deleted value)? deleted,
    required TResult orElse(),
  }) {
    if (deleted != null) {
      return deleted(this);
    }
    return orElse();
  }
}

abstract class Deleted implements GroupFormEvent {
  const factory Deleted() = _$Deleted;
}
